    of the Southern Half of the Pseudo-colored Backscatter Intensity of the Sea Floor
    off Eastern Cape Cod (CAPESOUTHPSEUDO_GEO4M_WGS84.TIF, Geographic, WGS84)",nt"tracking_summary":
